import React, {Component} from "react";
import ReactDOM from 'react-dom';

class SeacrchTracks extends Component {
    state = {tracksQuery: ''};

    updateTrackQuery = (e) => {
        this.setState({tracksQuery: e.target.value});
    };
    searchTracks = (e) => {
        console.log(this.state.tracksQuery);
    };

    render() {
        return (
            <div>
                <input onChange={this.updateTrackQuery} placeholder='Search for a track'/>
                <button onClick={this.searchTracks}>Search</button>
                <br/>
            </div>

        )
    }
}

export default SeacrchTracks;
